Lui kuat dhuol ca yok tah leng yen kuony tuong wiic.
· Loi ta bi yin ya yok thin komputayic ta wic yin kuony.
· Jaas —col 703-594-2168. Ka yin abi muoth ci dom thon matuongdit ping.ten dom wetdun wic ba luel ta ci yen thook.raan ageer wuel yic abi wok jal kuony dhung dhom.
· Yin yi tok—nem pan abun manhdu ..Aci rot bi ya leu akolkol bi raan jam thoungdu ya reer thin.Ka ye ten raan lui thin abi kuony ba thor loi,kua thor thiec wuel ku bi kuony wuel yam bi yen yi kony.
Kang ben yic yin abi thiec kaka buoth ke couk gam:
o Rien ku ku rien manhdu;
o Pan abun manhdu ,ku hon reer yen thin,ku rien raan de pioc;
o Ku raan tok wic bi wek jam,ye rienke wala lonloi ku ke jaamka yic;
o Ku yin bi jassdu nyang piny ku namberde ku luel dhaman path ke yin.ku bi ya yok.
